import React from 'react';
import styled from 'styled-components';

const ContainerHeader = styled.div`
  padding: 50px 0 40px;
`

const FirstTitle = styled.h1`
  margin: 0 0 10px 0;
  text-align: center;
`
const SecondTitle = styled.h1`
  text-align: center;
  margin: 0;
`

const Header = () => (

  <Container>
    <ContainerWrap>
        <ItemWrap>
          <p>teste</p>
        </ItemWrap>
    </ContainerWrap>
  </Container>

);

export default Header;
